import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { feedsSelector, fetchFeeds } from "../../slices/feeds";
import { Box } from "@material-ui/core";

const Feeds = () => {
  const dispatch = useDispatch();
  const { feeds } = useSelector(feedsSelector);
  useEffect(() => {
    dispatch(fetchFeeds());
  }, [dispatch]);

  // const renderPosts = () => {
  //   if (feeds) return { feeds };
  // };

  const renderbase = ({ feeds }) => {
    if (feeds) {
      return Object.keys(feeds).map((item, index) => {
        return (
          <option value={feeds[item].code} key={index}>
            {feeds[item].symbol}
          </option>
        );
      });
    }
  };

  return (
    <div>
      Feed
      {renderbase()}
    </div>
  );
};

export default Feeds;
